description:
Forced to give up his dreams of art school, Zach spends his days working a dead-end job and helping his needy sister care for her son. In his free time he surfs, draws and hangs out with his best friend, Gabe, who lives on the wealthy side of town. When Gabe&amp;#039;s older brother, Shaun, returns home, he is drawn to Zach&amp;#039;s selflessness and talent. Zach falls in love with Shaun while struggling to reconcile his own desires with the needs of his family.
